import React,{useEffect,useState} from 'react'

const DeleteAPI = () => {

    const[users,setUsers] = useState([])
    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/posts").then((result)=>{
            result.json().then((resp)=>{
                // console.log(resp)
                setUsers(resp)
            })
        })
    },[])

  return (
    <div>
        <h1>Delete Data with API Call</h1>
        <table border="1">
            <tr>
                <td>UserId</td>
                <td>ID</td>
                <td>Title</td>
                <td>body</td>                
            </tr>

            {
                users.map((item,i)=>{                  
                    <tr>
                        <td key={i}>{item.userID}</td>   
                        <td>{item.id}</td>                     
                        <td>{item.title}</td>
                        <td>{item.body}</td>                        
                    </tr>
                })
            }

        </table>
    </div>
  )
}

export default DeleteAPI
